import { API } from "../../backend";

export const getProducts = () => {
    return fetch(`${API}/products`, { method: "GET" })
        .then(response => {
            return response.json();
        })
        .catch(err => console.log(err));
};


export const confirmOrder = () => {
    return fetch(`${API}/products`, { method: "GET" })
        .then(response => {
            return response.json();
        })
        .catch(err => console.log(err));
};
